import "./App.css";

function App() {
  const names = [
    "Hooyo",
    "Abti",
    "Najad",
    "Hanad",
    "Ahmed", "Ruwaydah","Rayana",
  ];

  return (
    <div className="App">
      {names.map((names, key) => {
        return <h1 key={key}>{names}</h1>;
      })}
    </div>
  );
}

export default App;
